import React from "react";
import Newsletter from "./Newsletter";
import Navbar from "./Navbar";
import FK from "/Users/duaashahid/Desktop/olive/src/pictures-olive/FK.jpg";
import ReactRoundedImage from "react-rounded-image";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import img1 from "/Users/duaashahid/Desktop/olive/src/pictures-olive/imgwtv.png";

const logos = [
  img1,
  img1,
  img1,
  img1,
  img1,
  img1
  // Add more logo images here
];
const textBelowImages = [
  "SAP Consulting Services",
  "Information Security",
  "Software Testing and QA Sevices",
  "SAP S/4 HANA",
  "Cloud Infrastructure Services",
  "Software Development Services",
  "Trainings",
  // Add more descriptions here
];

function IT() {
  const settings = {
    infinite: true,
    speed: 3000,
    slidesToShow: logos.length - 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 0,
    centerMode: true,
    centerPadding: "0",
    swipeToSlide: false,
  };
  return (
    <div>
      <Navbar />
      <div className="w-full md:h-[600px]  bg-[#F1F8FF] justify-center  items-center sm:h-[800px] pt-20 ">
        <h1 className=" text-3xl   justify-center text-center">
          "OLIVE cloud Platform (OCP) will provide reliable, responsive and
          transparent cloud services to the market"
        </h1>
        <h1 className=" text-2xl  justify-center pt-4 text-center">
          Fakhar ul Hasan Mahmood
        </h1>
        <h1 className=" text-2xl pt-4 text-center">CIO</h1>
        <div className="w-[250px] mx-auto pt-20 first-letter:justify-center items-center ">
          <ReactRoundedImage
            roundedColor=""
            imageWidth="250"
            imageHeight="250"
            image={FK}
          />
        </div>
      </div>

     < div className="w-full">
        <h1 className="text-center text-2xl pt-10">Key Offerings</h1>
          <Slider {...settings} className="pt-10 pb-10">
            {logos.map((logo, index) => (
              <div key={index} className="text-center">
                <img
                  src={logo}
                  alt={`Logo ${index}`}
                  className="mx-auto w-32"
                />
                <p className="mt-2">{textBelowImages[index]}</p>
              </div>
            ))}
          </Slider>
        </div>
        <div className="w-full md:h-[300px]  bg-[#F1F8FF] justify-center  items-center text-center sm:h-[800px] pt-20 ">

            <h1 className="text-xl items-center text-center pt-5 mx-60"> Because with us, you'll experience a journey marked by excellence, unwavering reliability, top-quality service, rock-solid stability, and speedy responsiveness, all designed to elevate your business to new heights.</h1>
           <div className="pt-10">
           <buthon className=" justify-center items-center bg-[#1D5ADE] w-[200px]  rounded-full font-medium py-5 px-5  text-white md:mx-60 hover:scale-110">Download Brochure</buthon>
           </div>
        </div>
        <div className="w-full md:h-[200px]  justify-center  items-center text-center sm:h-[800px] pt-10 ">
        <h1 className="text-2xl items-center text-center">Software Development Services</h1>
        <div className="flex w-[500px]">
        <img src={img1} alt=""  />
        <img src={img1} alt="" />
        </div>
        </div>
      <Newsletter />
    </div>
  );
}

export default IT;
